import styled from 'styled-components'

export const HeaderContainer = styled.div `
	display: flex;
	align-items: center;
	height: 90px;
	padding: 20px;
	font-family: monospace;
	font-size: 20px;
	background-color: #b4e5f6;
	justify-content: space-between;
`
export const Image = styled.img ` 
	align-self: center;
	height: 90px;

`
